      if(SAFE_MODE) console.info('[SAFE MODE] Proteksi dibatasi (dev environment).');
      
      try{
        var threshold = 160;
        setInterval(function(){
          try{
            var wDiff = Math.abs(window.outerWidth - window.innerWidth);
            var hDiff = Math.abs(window.outerHeight - window.innerHeight);
            if(wDiff > threshold || hDiff > threshold){
              console.warn('[Anti-Debug] DevTools or unusual viewport detected (non-blocking).');
              if(!document.getElementById('__th_anti_debug_warn')){
                var b = document.createElement('div');
                b.id='__th_anti_debug_warn';
                b.style.position='fixed'; b.style.bottom='8px'; b.style.right='8px'; b.style.zIndex=99999;
                b.style.padding='8px 10px'; b.style.borderRadius='8px'; b.style.background='rgba(255,255,0,0.12)';
                b.style.color='#fff'; b.style.backdropFilter='blur(4px)'; b.style.fontSize='12px';
                b.textContent='Warning: DevTools detected';
                try{document.body.appendChild(b);}catch(e){}
              }
            }
          }catch(e){}
        }, 1500);
      }catch(e){}
      
      
      
    }catch(protErr){ console.warn('[Protection Error]', protErr); }
  }, 1200);
}catch(err){ console.error('[Decoder Error]', err); }
})();</script>
</body>
